using namespace std;



class DoubleLetter {
public:
	string ableToSolve(string s) {
		stack<int>S;
		int n = s.size();
		for(int i = 0; i<n; i++)
		{
			if(!S.empty())
			{
				if(S.top()==s[i]) S.pop();
				else S.push(s[i]);
			 }
			 else S.push(s[i]);
		}
		if(!S.empty()) return "Impossible";
		else return "Possible";
	}
};


